import { motion } from "framer-motion"
import estyle from "./Preloader.module.scss"

const Preloader = ({props}) => {

    // const svgVariants = {
    //     ready: { opacity: 0 },
    //     start: { opacity: 1, transition: { delay: props.delay1, duration : props.duration1 }}
    // }

    // const tophalfintro = {
    //     ready: { scale:.8, y:200 },
    //     start: { scale:1, y:0,
    //         transition: {
    //             scale: { duration:props.duration1, type:'tween', ease:'anticipate' },
    //             y:{ delay:props.delay2, duration: props.duration2, type:'tween', ease:'anticipate'}
    //         }}
    // }

    // const bottomhalfintro = {
    //     ready: { scale:.8, y:-200 },
    //     start: { scale:1, y:0, 
    //         transition: {
    //             scale: { duration: props.duration1, type:'tween', ease:'anticipate' },
    //             y:{ delay:props.delay2, duration: props.duration2, type:'tween', ease:'anticipate'}
    //         }}
    // }

    const svgVariants = {
        ready: { scaleX:.01, scaleY:0, y:50 },
        start: { scaleX:1, scaleY:1, y:0, 
            transition: { 
                scaleY: { delay: 2.35, duration: .25, type:'tween', ease:'easeIn' },
                y: { delay:2.35, duration: .25, type: 'tween', ease:'easeIn' },
                scaleX: { delay: 2.6, duration: .25, type:'tween', ease:'backOut' }

            }
        }
    }




    const preloaderBarAnim = {
        ready: {scaleX:0, left:0},
        start: { scaleX: 1, left:0,
            transition: { 
                scaleX: { duration:1, type:'tween', ease:'anticipate' }
                // left: {duration:1, type:'tween', ease:'anticipate'}
            }
        }
    }

    return (
        <div>
            <motion.div 
            className={estyle.preloaderbar}
            variants={preloaderBarAnim}
            style={{ position:"absolute", left:"0", top:"50%" }}
            initial="ready"
            animate="start" 
            >

            </motion.div>
        </div>
    );
};

export default Preloader;
